import React from 'react'
// import Comman from './Comman'
import web from "./aj.webp"
import Card from './Card'



const Services = () => {
  return (
    <>
        <Card name='Welcome to About page' imgsrc={web} visit="/contact" btname="Contact Now" />           
    </>
  )
}

export default Services
